The round function in C rounds a double to the nearest integer, while printf does its own rounding of the output. In this case you want to round the input to 2 decimal places before it is used in your program, not just when printing.
You should use printf with %.1f or %.2f instead of %f
Here's an example:
```
#include <stdio.h>

int main() {
    double d = 3.14159;

    printf("Original: %f\n", d);
    printf("Rounded to 1 dp: %.1f\n", d);
    printf("Rounded to 2 dp: %.2f\n", d);

    return 0;
}
```

If you really need to round it and store the result back into a double variable then you will have to do that manually by adding half of the smallest unit you wish to round to, before casting to an int, then back to a double.
